import React from "react";
import './styles.css'
import MenuItem from "../MenuItem";

export default function DropdownMenu() {
  return (
    <div class="dropdown">
      <MenuItem
      class="dropbtn"
      text="Menu 2 " />

      <div class="dropdown-content">
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
      </div>
    </div>
  );
}
